import logo from './logo.svg';
import './App.css';

function MyButton() {
  return (
    <button>I'm a button</button>
  );
}

function App() {
  return (
    <div className="App">
      <MyButton />
      <MyButton />
      <MyButton />
      <MyButton />
    </div>
  );
}

export default App;
